    char *relation = strtok(NULL, " ");
    char *name2 = strtok(NULL, " ");

    Node *node1 = findNode(root, name1);
    Node *node2 = findNode(root, name2);

    if (strcmp(relation, "is") == 0) {
        relation = strtok(NULL, " ");
        if (strcmp(relation, "a") == 0) {
            relation = strtok(NULL, " ");
